import React from "react";
import AnswerContainer from "./AnswerContainer";


class QuestionItem extends React.Component {

    render() {
        return (
            <div>
            <li >
                <span style={{
                    "marginLeft": "50px",
                    "fontSize": "23px"
                }}>{this.props.quest.text}</span>
            </li>
                <AnswerContainer />
            </div>
        )
    }
}

export default QuestionItem
